import React, {Component} from 'react';
import img from '../logo.svg';
import {Link} from 'react-router-dom';
import styled from 'styled-components'


export default class Navbar extends Component {
    render(){
    return (
        <NavWrapper className="navbar navbar-expand-sm navbar-darkpx-sm-5">
            <ul>
            <li>
            <Link to='/' className="navbar-nav nav-link align-items-center">
               Home 
            </Link>
            </li>
            <li>
            <Link to='/Menu' className="navbar-nav nav-link align-items-center">
               Menu
            </Link>
            </li>
            <li>
            <Link to='/About' className="navbar-nav nav-link align-items-center">
               About
            </Link>
            </li>
            <li>
            <Link to='/Contact' className="navbar-nav nav-link align-items-center">
               contact
            </Link>
            </li>
            </ul>
        </NavWrapper>
    )
}
}


const NavWrapper = styled.nav`
background: var(--mainGrey);
.nav-link{
    margin-left: 70px;
    color: var(--lightPink);
    font-size:1.3rem;
    text-transform: capitalize;

}
.nav-link:hover{
    color:var(--darkPink);
}
li{

    float: right;

}
ul{

    list-style-type: none;
    margin:0;
    padding: 0;
    overflow: hidden;
}




`
